import React, { useEffect } from 'react';
import { Layout, Row, Col } from 'antd';
import Navbar from '../../components/Navbar'
import styled from 'styled-components'
import FirstSection from './FirstSection'
import Particles from 'react-particles-js'

const BackgroundPolygons = styled(Particles)`
    background-color: #FFCB05;
    position: absolute;
    height: 120%;
    width: 100%;
`

const LayoutStyled = styled(Layout)`
    background: rgba(0,0,0,0);
`

const MainPage: React.FC = () => {
    return (
        <LayoutStyled>
            <Navbar/>
            <BackgroundPolygons params={{
                    "particles": {
                        "number": {
                            "value": 160,
                            "density": {
                                "enable": false
                            }
                        },
                        "size": {
                            "value": 3,
                            "random": true,
                            "anim": {
                                "speed": 4,
                                "size_min": 0.3
                            }
                        },
                        "line_linked": {
                            "enable": false
                        },
                        "move": {
                            "random": true,
                            "speed": 1,
                            "direction": "top",
                            "out_mode": "out"
                        }
                    }
                }}/>
            <Row>
                <Col span={4}/>
                <Col span={16}>
                    <FirstSection/>
                </Col>
                <Col span={4}/>
            </Row>
        </LayoutStyled>
    )
};

export default MainPage
